  return (
    <div className="
    bg-blue-500 
    w-screen 
    h-14
    auto-cols-auto
    flex 
    justify-center items-center
    ">
      <div>
        <h1 className='
        text-2xl
        font-bold
        h-fit
        w-fit
        '>Text A Message!</h1>
      </div>

      <div className='
      absolute
      w-1/6
      h-1/6
      bottom-0 left-1/6 top-0 right-0
      '>

        <motion.img
        whileInView={{}}
        whileHover={{ scale: 1.2 }}
        transition={{ duration: .2, ease: 'easeInOut' }}
        src={pikachu}
        alt=""
        className=""
      />
      </div>
    </div>
  );
}

export default Navbar;
